import React from 'react';
import './Country.css';
import { Link } from 'react-router-dom';


export function Country () {
    let flag = "https://restcountries.eu/data/col.svg";
    let name = 'Colombia';
    let capital='Bogota';
    let continent='America del Sur'

    return (
        <Link to='/Country'>
        <div className='countryCard'>
            <img className='img' src= {flag} />
            <div className="countryBody">
              <div >
              <p>Nombre :</p>
              <p>{name}</p>
              </div>
              <div >
              <p>Capital :</p>
              <p>{capital}</p>
              </div>
              <div >
              <p>Continente :</p>
              <p>{continent}</p>
              </div>
            </div>
        </div>
        </Link>
    )
};

export default Country;
